script: |
  super -f text -I q5285.spq | sort > q5285.out

inputs:
  - name: q5285.spq
    data: |
      SELECT DISTINCT - tab2.col0 AS col1 FROM tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q5285.out
    data: |
      -7
      -78
      -79
